    const { data, isLoading, error } = useGQLQuery('username', GET_USER);

    // Error and Loading states
    if (error) return <div>Request Failed</div>;
    if (isLoading) return <div>Loading...</div>;

    console.log(data)

    return (
        <div>
            <h1>Random Fact:</h1>
            <p>{data.data}</p>
        </div>
    )
}

export default ProfileInfo
